This guidebook combines the interests and enthusiasms of two of the world&amp;#039;s best-known information providers: Insight Guides, whose titles have set the standard for visual travel guides since 1970, and Discovery Channel, the world&amp;#039;s premier source of nonfiction television programming. The editors of Insight Guides provide both practical advice and general understanding about a destination&amp;#039;s history, culture, institutions and people. Discovery Channel and its website, www.discovery.com, help millions of viewers explore their world from the comfort of their own homes and also encourage them to explore it first-hand. In this, the third edition of &quot;Insight Guide: Japan&quot; we journey to one of the most captivating and confounding nations. An archipelago of ancient enigmas and exquisite art, Japan offers a traveller the most immense of cities, delicate of cuisines, diverse of environments, and the most confusing of cultures. Our writers and photographers will help reveal it all.
